import "./App.css";
import Footer from "./Footer";
import Header from "./Header";
import Leftside from "./Leftside";
import Rightside from "./Rightside";


function App() {
  return (
    <div className="bg-secondary">
      <Header></Header>
      <div className="container mt-5">
        <div className="row">
          <Leftside></Leftside>
          <Rightside></Rightside>
        </div>
      </div>
      <Footer></Footer>
    </div>
  );
}

export default App;
